import React from 'react';

// Components
import { CharacteristicCard } from '../../pages/stays/containers/CharacteristicCard';

interface Prop {
  host_is_superhost: string;
  host_name: string;
}

export const Characteristics: React.FC<Prop> = ({
  host_is_superhost,
  host_name
}) => {
  return (
    <>
      <div className='my-6 border-b border-gray-300'>
        <CharacteristicCard
          type='home'
          title='Entire Home'
          description='You will have the house to yourself.'
        />
        <CharacteristicCard
          type='clean'
          title='Sparkling clean'
          guestnumber={13}
          description='recent guests said this place was sparkling clean.'
        />
        {host_is_superhost === 't' ? (
          <CharacteristicCard
            type='superhost'
            hostName={host_name}
            title='is a Superhost'
            description='Superhosts are experienced, highly rated hosts who are committed to providing great stays for guests.'
          />
        ) : null}

        <CharacteristicCard
          type='location'
          title='Great location'
          percentage={90}
          description='of recent guests gave the location a 5-star rating.'
        />
      </div>
    </>
  );
};
